import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [prompt, setPrompt] = useState('');
  const [model, setModel] = useState('model1');
  const [progress, setProgress] = useState(0);
  const [eta, setEta] = useState(0);
  const [imageUrl, setImageUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [imageError, setImageError] = useState(false);
  const [galleryImages, setGalleryImages] = useState([]);

  // Fetch gallery images from backend.
  const fetchGallery = async () => {
    try {
      const res = await fetch('http://localhost:8080/gallery');
      const data = await res.json();
      setGalleryImages(data.images || []);
    } catch (error) {
      console.error("Error fetching gallery:", error);
    }
  };

  // Fetch gallery on mount and after each generation.
  useEffect(() => {
    fetchGallery();
  }, [loading]);

  // Poll backend for progress updates.
  const pollProgress = (selectedModel) => {
    const interval = setInterval(async () => {
      try {
        const res = await fetch(`http://localhost:8080/progress?model=${selectedModel}`);
        const data = await res.json();
        setProgress(data.progress);
        setEta(data.eta);
        if (data.progress >= 100) clearInterval(interval);
      } catch (error) {
        console.error("Error polling progress:", error);
        clearInterval(interval);
      }
    }, 1000);
  };

  const handleGenerate = async (e) => {
    e.preventDefault();
    setProgress(0);
    setEta(0);
    setImageUrl('');
    setImageError(false);
    setLoading(true);
    if (model !== 'dalle') {
      pollProgress(model);
    }
    try {
      const response = await fetch('http://localhost:8080/generate', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ prompt, model }),
      });
      if (!response.ok) {
        throw new Error(`Server error: ${response.status}`);
      }
      const data = await response.json();
      setImageUrl(data.imageUrl);
      // Refresh gallery images after generation.
      fetchGallery();
    } catch (error) {
      console.error("Error in handleGenerate:", error);
      setImageError(true);
    } finally {
      setLoading(false);
    }
  };

  const handleRegenerate = () => {
    // Clear current image and reset form.
    setPrompt('');
    setImageUrl('');
    setProgress(0);
    setEta(0);
    setImageError(false);
  };

  // Helper: Returns an absolute URL.
  const getImageUrl = () => {
    return imageUrl.startsWith("http") ? imageUrl : `http://localhost:8080${imageUrl}`;
  };

  return (
    <div className="app-container">
      <header className="app-header">
        <h1>Image Generator</h1>
        <p className="tagline">Generate stunning images with AI</p>
      </header>
      <main className="main-content">
        <form onSubmit={handleGenerate} className="gen-form">
          <input
            type="text"
            value={prompt}
            onChange={(e) => setPrompt(e.target.value)}
            placeholder="Enter your prompt..."
            required
            className="prompt-input"
          />
          <select
            value={model}
            onChange={(e) => setModel(e.target.value)}
            className="model-select"
          >
            <option value="model1">Asian Model</option>
            <option value="model2">Anime Model</option>
            <option value="dalle">DALLÂ·E</option>
          </select>
          <div className="form-buttons">
            {imageUrl ? (
              <button type="button" onClick={handleRegenerate} className="regen-button">
                New Prompt
              </button>
            ) : (
              <button type="submit" className="gen-button" disabled={loading}>
                {loading ? "Generating..." : "Generate Image"}
              </button>
            )}
          </div>
        </form>
        {loading && model !== "dalle" && (
          <div className="progress-bar-container">
            <progress value={progress} max="100" className="progress-bar"></progress>
            <div className="progress-info">
              <span>{progress}%</span>
              <span>ETA: {eta} sec</span>
            </div>
          </div>
        )}
        {imageUrl && (
          <div className="image-display">
            <h2>Generated Image</h2>
            {imageError ? (
              <p className="error-text">Image generation failed.</p>
            ) : (
              <img
                src={getImageUrl()}
                alt="Generated"
                className="generated-img"
                onError={() => setImageError(true)}
              />
            )}
          </div>
        )}
      </main>
      <footer className="gallery-footer">
        <h2>Gallery</h2>
        <div className="gallery-scroll">
          {galleryImages.length > 0 ? (
            galleryImages.map((imgUrl, idx) => (
              <img
                key={idx}
                src={imgUrl}
                alt={`Gallery ${idx}`}
                className="gallery-item"
              />
            ))
          ) : (
            <p>No images available.</p>
          )}
        </div>
      </footer>
    </div>
  );
}

export default App;
